if mibBuilder.loadTexts: lldpV2RemTable.setDescription('This table contains one or more rows per physical network connection known to this agent. The agent may wish to ensure that only one lldpRemEntry is present for each local port and destination MAC address, or it may choose to maintain multiple lldpRemEntries for the same local port and destination MAC address. The following procedure may be used to retrieve remote systems information updates from an LLDP agent: 1. NMS polls all tables associated with remote systems and keeps a local copy of the information retrieved. NMS polls periodically the values of the following objects: a. lldpV2StatsRemTablesInserts b. lldpV2StatsRemTablesDeletes c. lldpV2StatsRemTablesDrops d. lldpV2StatsRemTablesAgeouts e. lldpV2StatsRxPortAgeoutsTotal for all ports. 2. LLDP agent updates remote systems MIB objects, and sends out notifications to a list of notification destinations. 3. NMS receives the notifications and compares the new values of objects listed in step 1. Periodically, NMS should poll the object lldpV2StatsRemTablesLastChangeTime to find out if anything has changed since the last poll. if something has changed, NMS polls the objects listed in step 1 to figure out what kind of changes occurred in the tables. if value of lldpV2StatsRemTablesInserts has changed, then NMS walks all tables by employing TimeFilter with the last-polled time value. This request returns new objects or objects whose values have been updated since the last poll. if value of lldpV2StatsRemTablesAgeouts has changed, then NMS walks the lldpStatsRxPortAgeoutsTotal and compares the new values with previously recorded ones. For ports whose lldpStatsRxPortAgeoutsTotal value is greater than the recorded value, NMS can retrieve objects associated with those ports from table(s) without employing a TimeFilter (which is performed by specifying 0 for the TimeFilter.) lldpV2StatsRemTablesDeletes and lldpV2StatsRemTablesDrops objects are provided for informational purposes.')
